            "markdown": "South Dakota Biotech Breakthrough Summit 2019 ============================================= Posted September 10th, 2019 **October 8, 2019 | Sioux Falls, SD** **Join us for BREAKTHOUGH! the 2019 South Dakota Biotech Summit & Awards.** --------------------------------------------------------------------------- _Learn about the amazing breakthroughs happening all around us, from human and animal health to agriculture. And collaborate on how we can continue breaking through the barriers of deploying these new technologies to heal, fuel and feed a growing world._ **BREAKTHROUGH** In biotechnology, breakthroughs can be big and small. They happen every day, and they take years – or even decades. This is a day to come together as an industry, to share our breakthroughs, to talk about our challenges and to learn from one another. Whether you’re just beginning your biotech endeavor or working on your next milestone, we welcome you and will support you along the journey. **President’s Address** **Sue Lancaster,** vice president of corporate development for **[SD Innovation Partners](https://www.southdakotainnovation.com/) **, serves as board president for **South Dakota Biotech**. She will share highlights for the association from the past year and provide an overview of relevant issues and progress being made at the state and national levels **The Protein Highway – The Current State of Protein Companies** The protein industry has the potential to be a powerhouse for growth in South Dakota. **Phil Kerr**, chief technical officer, is helping lead the way through his role at **[Prairie Aquatech](https://www.prairieaquatech.com/) **. He will share the state of the industry and what challenges must be overcome to strengthen its presence in South Dakota. **Fireside Chat: Building a Regional Biotech Ecosystem** In our part of the country, we soon realize we have more in common than not. That’s certainly the case in biotechnology, where our shared strengths can lead to opportunities to expand our industry in the Midwest. We welcome our BIO affiliate counterparts from surrounding states and look forward to learning their best practices and our opportunities for continued collaboration. **Track One: Entrepreneurial Path to Translation** Starting any business presents its share of hurdles, but in biotechnology there are especially unique considerations. This track at the summit will prepare you to address them, from the path to commercialization of research to business plan basics. Get connected to the resources in place to help you avoid start-up pitfalls and set yourself up for success. **Track Two: Professional Development** No matter what your career stage, our changing business landscape demands you keep your skills sharp. This track at the summit will leave you with new expertise, thanks to leading area organizations on the cutting edge of their industries. From security to quality, personnel to regulatory changes, you’ll be armed with information you can immediately put to work. [_**FULL SCHEDULE HERE**_](https://www.sdbio.org/upcoming-events) ------------------------------------------------------------------ [_**PURCHASE TICKETS HERE**_](https://www.eventbrite.com/e/south-dakota-biotech-breakthrough-summit-2019-tickets-72275577197?aff=ebdshpsearchautocomplete) ----------------------------------------------------------------------------------------------------------------------------------------------------------- [Back to News](blog)"
