            "id": "https://www.sdbio.org/blog/bio-international-convention_chunk_0",
            "markdown": "BIO International Convention ============================ Posted June 7th, 2024 South Dakota biotech leaders and organizations will be building national and even global relationships this week at BIO 2024. The annual conference of biotech’s international organization is held June 3-6 and South Dakota will be well represented. Eddie Sullivan, co-founder and president of Sioux Falls-based SAB Biotherapeutics, serves on the board of directors for BIO, which is the world’s largest advocacy association representing biotechnology companies, academic and research institutions, state biotechnology centers and related organizations across the United States and in more than 30 other nations. Additional, Joni Ekstrum, executive director of South Dakota Biotech, serves as chair of the Midwest region for the Council of State Biotech Affiliates, serving as a liaison between the region and the broader BIO organization. “South Dakota is well represented in national leadership within the biotech industry, and it’s an important way for us to ensure our state’s voice is heard,” Ekstrum said. “Events like the annual BIO convention are a way for us as well as business and organizations within our state to tell our story and make connections that lead to valuable business development.” BIO 2024, held in San Diego, represents the world’s largest gathering of the biotechnology industry, as well as an introduction for new president and CEO John Crowley, who assumed the role a few months ago. “He’s leading a broader relaunch of the organization and I think his priorities are very positive for small to mid-sized biotech companies,” Ekstrum said. “He was CEO of a biotech company and is a rare disease advocate having experienced that in his family, so I’m looking forward to working with him and the leadership I see him providing.” Several South Dakota organizations will be attending BIO, including Missouri Breaks Industries Research Inc., which has a mission of research done by Native Americans, for Native Americans. Based on the Cheyenne River Sioux Reservation in north-central South Dakota, the organization has connected with South Dakota Biotech thanks to a grant from the U.S. Small Business Administration that supports outreach and new partnerships. “It’s been a great relationship. We’re so enthusiastic about this organization’s success and potential and excited to see what develops thanks to their attendance at BIO 2024,” Ekstrum said. CEO Marcia O’Leary and lead clinical research coordinator Angel Flying Hawk will be attending. “Our goal is not only to bring relevant research to our communities but also to increase capacity in these same communities. It is critical for our Tribal communities to have equal access to the newest medical treatments and to have confidence through clinical trials that these treatments have evidence-based results,” O’Leary said. “This cannot be determined by only studying people from other locations of the country and hoping that they work for all populations. Missouri Breaks has meetings lined up with a number of pharmaceutical companies that could become partners in its work. Having the chance to offer clinical trials in addition to observational research further the outreach, education and health care options for the Native American population, so Missouri Breaks looks for research opportunities and partners to expand those opportunities. “The pharmaceutical companies have shown great interest in our population we currently serve,” Flying Hawk said. “We are excited to tell them more about our company and our potential recruits in our area.” The company’s vision “is to create opportunities for health and our mission is advancing innovative solutions through partnerships, data, and understanding,” she continued. “This event gives us the opportunity to find others who share our vision.” For a long time, many entities felt it wasn’t possible to work with or on Tribal nations, O’Leary added. “This is not true,” she said. “There are rules and laws that must be obeyed and respected — as tribes are sovereign nations that have authority to protect and preserve the health and welfare of their members. But they also have a commitment to improving the health and welfare of their members. The desire to improve the health of family, friends and neighbors is universal.” The growing relationship with the state’s biotech industry has been a benefit, O’Leary said. “It’s impressive. South Dakota Biotech has a true commitment to growing capacity in our state,” she said. “This organization has made an effort to get outside of its comfort zone and to bring willing partners together to maximize both the resources and the expertise of local organizations. We have indeed been fortunate to have them in our listening circle.” [Back to News](blog)"
