            "id": "https://www.sdbio.org/blog/biotech-breakfast-presentation-2023-legislative-update_chunk_0",
            "markdown": "Biotech Breakfast and Presentation: 2023 Legislative Update =========================================================== Posted March 30th, 2023 **Tuesday, April 11 · 7:45 - 9am CDT | Minnehaha Country Club 3101 West 22nd Street Sioux Falls, SD 57104** **Join us for a breakfast of networking and special presentation: 2023 Legislative Update with SD Biotech Lobbyist, Drew Duncan, and Senate Majority Leader Casey Crabtree.** 7:45-8:00 AM Registration & Breakfast 8:00-8:05 AM Welcome 8:05-9:00 AM Speaker Presentations followed by Q&A **SD Biotech Lobbyist, Drew Duncan** Drew Duncan received his undergraduate degree in 1999 from the University of Nebraska-Lincoln. While there, he was involved in many campus activities such as the Arts and Sciences Advisory Board and Delta Tau Delta Fraternity. In 2002, Drew received his law degree from the University of South Dakota School of Law. During his time at USD, he served as the Student Bar Association Vice-President in his second year and Student Bar Association President in his third year. Drew was also a member of USD’s Trial Team in 2002. Following law school, Drew clerked for the Fifth Circuit of the South Dakota Unified Judicial System in Aberdeen, South Dakota. Following his clerkship, he joined the law firm of Zimmer, Duncan and Cole in 2003. For roughly two years, Drew had the opportunity to serve as the Deputy State’s Attorney in Turner County, South Dakota. In that position, he earned a substantial amount of time in the Courtroom prosecuting criminal cases for the citizens of Turner County. Drew now focuses the majority of his practice on governmental relations (lobbying), criminal law, medical insurance law (ERISA claims), personal injury, and family law. Drew prides himself on being a responsible and active member of the community. Drew serves on the Board of Directors of Par Mar Valley Country Club and the Board of Directors of the Young Lawyers Section of the South Dakota Bar Association. Along with Dennis Duncan, Drew Duncan spends every legislative session lobbying for his clients’ interests in Pierre, South Dakota in front of the South Dakota Legislature. **Senate Majority Leader Casey Crabtree** Casey Crabtree currently serves as Director of Economic Development for Heartland Energy in Madison, South Dakota. He leads their efforts to attract new businesses and encourage existing businesses to expand in Heartland communities. He oversees the economic development programs including grants, energy incentives and revolving loan funds to facilitate growth in the region. He is a graduate of Northern State University, where he was also a four-year member of the football team. He graduated from the Leadership South Dakota program in 2017. Casey has spent much of his career working in business development and management. He has held positions for Daktronics in both Brookings, SD and Chicago, IL and with Interstate Batteries in Sioux Falls. Casey and his wife Ashley are also entrepreneurs and own small businesses in the Madison area. Casey has been elected to serve his second term in the South Dakota State Senate, representing District 8. He was elected Majority Leader by his colleagues for the 2023-2024 session. He is chairman of Senate State Affairs and a committee member of Commerce and Energy, Legislative Procedures and the Executive Board. He was previously elected Majority Whip by his peers in 2021 and served as chair of the Senate Commerce and Energy committee, and was a member of the State Affairs, Transportation and Legislative Procedures committees. He has also served on the Redistricting committee, and interim studies on workforce housing and property tax reduction efforts. Casey and Ashley live just outside of Madison with their two boys, where they enjoy attending sporting events and spending time outdoors. _**[TICKETS](https://www.eventbrite.com/e/biotech-breakfast-2023-legislative-update-tickets-600780850697?fbclid=IwAR1RVZpS-jSAdQ9tV55HJ3NMCLRWv0wtMjoMWOhgjfeORx8IjQrXuvFC6HI)**_ [Back to News](blog)"
