            "markdown": "SD Biotech Board of Directors Spotlight ======================================= Posted May 18th, 2023 **Meet Christoph Bausch, Ph.D.** TREASURER SD BIOTECH BOARD - SAB Biotherapeutics Christoph Bausch, Ph.D., MBA, is our Executive Vice President & Chief Operating Officer as of May 2022, overseeing all Research & Manufacturing operations of the company. Prior to his role as COO, he served as Chief Science Officer since joining SAB in April 2017, providing leadership in all areas of Research & Development, and functioning as drug development lead for a Stage 3 clinically advanced drug product. Dr. Bausch is an experienced research scientist, biotech entrepreneur, and business development executive who has led the successful discovery, development, biomanufacturing, and commercialization of platform technologies in the life sciences. Previously, Dr. Bausch has served as founder and director of a molecular diagnostic company and has provided life science consulting for Keion Group, LLC. Dr. Bausch held several science-based business development positions prior to joining SAB, most recently for multi-billion-dollar global industrial biomanufacturing leader POET, LLC, where he structured strategic partnerships, prospected and vetted new technologies, and streamlined research and development activities. He also worked in both research and commercialization roles for Fortune 500 life science and high technology company Sigma-Aldrich, now MilliporeSigma. Dr. Bausch currently serves on the Board of Directors for the state affiliate of BIO, South Dakota Biotech, since 2017. He received his Ph.D. in Microbiology at The Ohio State University, Columbus, Ohio, completed Post-Doctoral Training at the Stowers Institute for Medical Research, Kansas City, Missouri, and earned an MBA from St. Louis University, St. Louis, Missouri, in addition to a BA in Biology from the University of Nebraska-Lincoln, Lincoln, Nebraska. [Back to News](blog)"
