            "id": "https://www.sdbio.org/blog/usd-college-arts-sciences-responds-to-opportunities-challenges-big-data-ai_chunk_0",
            "markdown": "USD College of Arts & Sciences responds to the opportunities, and challenges, of big data, AI ============================================================================================= Posted February 6th, 2024 The use of artificial intelligence and machine learning to extract insights from big data has transformed nearly every part of life. At the forefront of these developments is the University of South Dakota. The growth of the undergraduate and graduate programs in computer science reflects the trends in AI and machine learning. Enrollment in these programs has increased by 66 percent and 500 percent, respectively, over the past two years. Yet the impact of these technological advances is felt beyond the computer science field, affecting multiple disciplines in the USD College of Arts & Sciences, said John Dudley, dean of the college. “AI has been all over the news recently, so we are all aware of its importance. In order to prepare our graduates for their careers and for the challenges and opportunities of a world dominated by the power of data, we need to train students to develop, use and understand AI tools across all the disciplines.” **Next generation of data scientists** USD is preparing the next generation of professionals with the knowledge to gather, analyze and interpret an ever-increasing amount of data that is too large and varied for traditional data-management systems. Over the past several years, the department of computer science has positioned itself as a leader in the rapidly growing field of data science. The bachelor’s degree in computer science is accredited by ABET, an organization that ensures a program has met standards essential to prepare graduates to enter critical science, technology, engineering and math fields in the global workforce. Under the direction of KC Santosh, who became chair of computer science in 2018, the department rapidly has expanded its programs and activities in areas related to AI and data analytics. “USD recognizes the growing demand for data scientists and is actively preparing students to meet this need through various initiatives and programs,” Santosh said. “We do this through curriculum expansion and collaboration, an interdisciplinary approach and research opportunities.” In 2019, the department announced that undergraduate and graduate students could earn a specialized computer science degree in AI, the first offered in South Dakota. The department also administers an undergraduate and graduate certificate in AI for students in any major. In addition, computer science coursework is featured prominently in disciplines throughout USD. “We serve other divisions and departments by integrating courses related to AI and data science with their curricula,” Santosh said. In the USD College of Arts & Sciences’ disciplines of biology, chemistry, sustainability, biomedical engineering and physics, computer science instruction plays a large role in select programs. Undergraduate students earning their certificate in geospatial analysis receive instruction on how to collect, analyze and visualize spatial data. While studying for their certificate in bioinformatics, graduate students learn about the computational tools that will allow them to gain insights from vast amounts of biological data. Paul Adam has made good use of varied offerings in data science during his time at USD. “I am a computer science major pursuing a business analytics minor,” said Adam, who is originally from Pierre. “This year, I also picked up a certificate in geospatial analysis. So I’m clearly on a data analytics career path.” When choosing to attend USD, the fourth-generation Coyote may have been predisposed to attend college in Vermillion, but the chance to learn with USD computer science faculty was what really sold Adam on the program. “Computer science has very distinguished faculty, people who are very good at what they do,” he said. “It’s been an honor to learn from them.” Adam said his computer science major pairs well with the business analytics minor. “I think business analytics really complements my computer science degree in that it forces me to make real-life interpretations of data and statistics,” he said. When Adam graduates this May, he hopes to find a career in business analytics and is excited to apply machine learning and AI tools to real-world problems. “AI can take a corpus of data that would be unfathomable for a person or even a team of people to try and comb through and write different types of analyses, so you can create a program that could do all of these things a lot more efficiently than a human,” he said. “Computers are really good at memorizing things, and they don’t forget.” Physics graduate students can specialize in analytics for large data sets by taking courses in machine learning and AI that provide them useful skills in material science as well as the opportunity to shed light on one of the most intriguing mysteries of the universe: dark matter. USD’s department of physics began offering the master’s specialization in analytics of large data sets in 2017, said Dongming Mei, Ph.D., professor of physics. “We have accumulated a lot of data,” he said, referring to the information collected from the department’s dark matter and neutrino research and its on-campus laboratory dedicated to growing extremely pure germanium crystals – one of the few such facilities in the world. Germanium is a rare metalloid used in sensors that detect dark matter. It also has industrial and commercial uses, such as in medical imaging and specialized electronics. Students in the program not only gain experience analyzing data from experiments at the Sanford Underground Research Facility in Lead, but also they take part in using AI tools to analyze data from 12 years of germanium crystal production. Mei said students working with this data can help speed up and streamline crystal production, giving graduates of the program experience sought after in industry as well as in academia. Mei refers to the process of growing high-quality germanium crystals as “challenging work,” especially when it comes to controlling crystal purity. “We need to have an increase in yield of this pure germanium crystal,” he said. “Our students are using data and machine learning and AI to help increase the yield.” **At forefront of data science research** The newest addition to the department of computer science’s academic offerings is a Ph.D. in data science and engineering, offered jointly with South Dakota Mines. This degree furthers the already-robust research program in data analytics, machine learning and AI by supporting top graduate students while they produce new knowledge through their own research and work on projects with department faculty. USD computer science faculty have wide-ranging collaborations in the U.S. and throughout the world – a significant advantage to the students who study here, Santosh said. Students are often co-authors on published studies that include analyzing foreign objects on chest X-rays with AI tools, using AI to predict male fertility, utilizing active learning to minimize the possible risk of future epidemics and examining AI ethical issues. In addition, computer science faculty collaborate on projects at some of the U.S. Department of Energy’s National Laboratories – including Brookhaven, Argonne and Lawrence Berkeley – where researchers address issues related to energy and climate, the environment, national security and health. “These relationships with national laboratories are definitely a plus for our graduates for their summer internships,” Santosh said. At USD, computer science students and faculty alike perform projects with researchers in the Sanford School of Medicine, School of Health Sciences and departments of biology, biomedical engineering, chemistry, physics, and sustainability and environment. The research capabilities of the department of computer science recently earned it federal research grant funding from the U.S. Department of Energy and Department of Defense, Santosh added. “USD’s AI programs are able to unite AI and data engineering experts in academia,"
