            "id": "https://www.sdbio.org/blog/dakota-state-announces-90m-initiative-to-grow-states-cyberresearch-industry_chunk_0",
            "markdown": "Dakota State announces $90M initiative to grow state's cyber-research industry ============================================================================== Posted January 29th, 2022 MADISON, S.D., January 26, 2022 On Jan. 26, Dakota State University announced a $90 million initiative to grow the cyber-research industry in South Dakota. Dakota State is known for its nationally recognized programs in cybersecurity. The Beacom College of Computer and Cyber Sciences graduates address the rapidly growing demand for cybersecurity professionals. However, many leave for the east or west coast for work. DSU wants more of these graduates to stay here, right in South Dakota, to perform the types of highly specialized work for which they are qualified. “We see this as an opportunity, a challenge,” said Dakota State University President José-Marie Griffiths. “We created a vision to expand DSU’s Applied Research Lab (ARL) to stimulate a vibrant cyber-research industry in Sioux Falls which supports national security and defense, offers workforce and economic development opportunities, and establishes South Dakota as a cyber state,” she said. “But we didn’t stop there. This five-year plan created includes opportunities for Madison and Sioux Falls, through a public/private partnership, which will further our cyber-research efforts,” Griffiths stated. **In Madison** * Continue to fill DSU’s ARL in Madison to 125-150 full-time jobs. * Increase DSU’s capacity to double the number of graduates of The Beacom College from 200 to 400 annually by recruiting and retaining faculty, students, and staff. * Expand the cyber talent pipeline and career pathways by launching the Governor’s Cyber Academy to offer dual credit programs to high school students statewide. **In Sioux Falls** * Expand DSU-ARL with a highly specialized facility which will be owned by the State via the Board of Regents and DSU. This facility is expected to open in fall of 2025 and support 400 to 500 full-time jobs. * Establish a non-profit corporation to hire DSU-ARL staff to perform and manage the applied research and lease space from DSU, both in Madison and Sioux Falls. * The new non-profit corporation will also run intensive summer cybersecurity bootcamps for students from other universities in South Dakota majoring in cyber-related disciplines such as computer science, computer engineering, software engineering, etc. These are anticipated to start in summer 2023. **The public/private partnerships** * $50 million over five years from philanthropist T. Denny Sanford to construct a highly specialized facility to house the expanded DSU-ARL in Sioux Falls with an estimated completion date of fall 2025. * 10 to 16 acres of land donated by Sanford Health at the Sanford Sports Complex adjacent to Sanford’s Virtual Care Center. * $10 million from the city of Sioux Falls\\* to create the physical, organizational, and programmatic infrastructure needed for the DSU-ARL in Sioux Falls. * $250,000 from Forward Sioux Falls for planning a Cyber/IT Park in Sioux Falls. * $30 million from the State of South Dakota proposed by Governor Noem in her FY23 budget request.\\* This will expand the educational capacity of The Beacom College in Madison to double the number of graduates from 200 to 400 per year and to launch the Governor’s Cyber Academy statewide to all high schools. * Execution of Plan will be done by Dakota State University and the South Dakota Board of Regents. ### _\\*Pending approval of the governing body._ **[Dakota State University](https://dsu.edu/) ** (DSU) is located in Madison, S.D. Founded in 1881, DSU offers undergraduate, master’s, and doctoral programs through its colleges of arts and sciences, business and information systems, computer and cyber sciences, and education. DSU has a special focus on the development, application, implications, and impacts of computing, information technologies and cyber security in all areas of human endeavor. DSU has received multiple Center of Academic Excellence designations in education, research and regional resource development from the U.S. National Security Agency and U.S. Department of Homeland Security. DSU is home to the Madison Cyber Labs (MadLabs®), a cyber R&D hub with labs and institutes that explore and advance technology application, workforce development, business expansion, economic growth, and policy improvement across multiple disciplines and fields. For more information, contact mediarelations@dsu.edu, 605-270-3816, or visit the DSU website at dsu.edu. [Back to News](blog)"
