            "id": "https://www.sdbio.org/blog_chunk_3",
            "markdown": "how the biotech industry in South Dakota is finding strong traction heading into the new year. The space inside First Financial Center, 100 S. Phillips Ave., puts South Dakota Biotech, the state affiliate of the international BIO organization, in the center of the Sioux Falls business district. The office officially opened last week. [Read More](blog/as-biotech-organization-moves-into-new-space-industry-finds-growing-momentum) November 16th, 2022 Biotech leaders recognized for industry contributions ----------------------------------------------------- South Dakota Biotech, the state affiliate of the international BIO organization, has recognized three industry leaders with its annual awards and a special proclamation. The LIVE and Distinguished Collaborator awards were established in 2014 to recognize individuals or organizations with exceptional dedication to advancing biotechnology. [Read More](blog/biotech-leaders-recognized-for-industry-contributions) November 3rd, 2022 Bio Business Solutions Spotlight: ODP ------------------------------------- **ODP Business Solutions**, formerly Office Depot®, is a leading B2B solutions provider serving small, medium, and enterprise level companies, through office supplies, print, workspace interiors, workspace facilities, and technology solutions. [Read More](blog/bio-business-solutions-spotlight-odp) November 1st, 2022 SD Biotech Board Updates ------------------------ The South Dakota Biotech board has elected officers: President, Mel Ustad, South Dakota EPSCoR; vice president, Mark Stowers, The Global Bluefish Co.; secretary, Kara McCormick, Sanford Research; treasurer, Christoph Bausch, SAB Biotherapeutics. [Read More](blog/sd-biotech-board-updates) October 28th, 2022 South Dakota Fast Launch Is Back -------------------------------- The South Dakota FAST Launch program is designed to assist South Dakota entrepreneurs and small businesses with beginning and expanding their business through the Governor’s Giant Vision Competition and SBIR/STTR funding. [Read More](blog/south-dakota-fast-launch-back) October 28th, 2022 First-of-its-kind sustainable aviation fuel facility in the world positions South Dakota to build on biofuels success --------------------------------------------------------------------------------------------------------------------- On 245 acres just outside Lake Preston, a facility unique worldwide is starting to take shape. A September groundbreaking marked the official start of South Dakota’s largest economic development project: a sustainable aviation fuel facility estimated at more than $1 billion to be built by Colorado-based Gevo Inc. [Read More](blog/firstofitskind-sustainable-aviation-fuel-facility-in-world-positions-south-dakota-to-build-on-biofuels-success) October 27th, 2022 October Bio Business Solutions Spotlight: PSC Biotech Corporation ----------------------------------------------------------------- SD Biotech Members Save with BIO Business Solutions. Bio negotiates significant volume-based discounts, favorable terms, and other benefits on products and services with industry leading suppliers on behalf of BIO members and the members of state and regional biotech associations. [Read More](blog/october-bio-business-solutions-spotlight-psc-biotech-corporation) October 3rd, 2022 SD Biotech Members SAVE! ------------------------ BIO Business Solutions offer Moving & Relocation Benefits for BIO Members with United Van Lines. [Read More](blog/sd-biotech-members-save) September 21st, 2022 2022 SD Biotech Summit Schedule And Speakers -------------------------------------------- The SD Biotech Summit will bring together national, regional and local thought leaders who will provide insights that will impact all of our futures. [Read More](blog/2022-sd-biotech-summit-schedule-speakers) September 21st, 2022 Biotech Mixer ------------- Catch up with SD Biotech members and biotech colleagues. [Read More](blog/biotech-mixer) September 20th, 2022 Allergy-friendly baking mix business expands into retail sales -------------------------------------------------------------- South Dakota Biotech Fast Launch helps launch allergy-friendly retail business. [Read More](blog/allergyfriendly-baking-mix-business-expands-into-retail-sales) September 20th, 2022 Aviation fuel producer breaks ground on massive S.D. project ------------------------------------------------------------ Colorado-based Gevo Inc. officially has started work on a massive project in Lake Preston estimated at more than $1 billion that will produce sustainable aviation fuel. [Read More](blog/aviation-fuel-producer-breaks-ground-on-massive-sd-project) September 20th, 2022 2022 SD Biotech Summit ---------------------- The **2022 SD Bio Summit** returns in-person to Brookings next month! Join us to explore “IMPACTS\" and learn how breakthroughs in biotech innovations are transforming our world. [Read More](blog/2022-sd-biotech-summit-1) September 20th, 2022 September Bio Business Solutions Spotlight: Nikon ------------------------------------------------- Nikon is a market leader in optics instrumentation and the only microscope company to manufacture its own glass, ensuring the very finest quality assurance throughout production. [Read More](blog/september-bio-business-solutions-spotlight-nikon) September 1st, 2022 Welcome New Member: CBS Bio Platforms Inc. ------------------------------------------ CBS Bio Platforms Inc. is an innovation-focused company that researches, develops and manufactures a wide range of products used in feed, food, industrial and environmental applications. [Read More](blog/welcome-new-member-cbs-bio-platforms-inc) August 8th, 2022 Avera joins health intelligence company to advance genetics-driven cancer treatment ----------------------------------------------------------------------------------- The difference between looking at some genes involved in fighting cancer versus every gene involved in fighting cancer can be life-changing for the patient involved. [Read More](blog/avera-joins-health-intelligence-company-to-advance-geneticsdriven-cancer-treatment) July 13th, 2022 Ag biotech leader helps startups from Sioux Falls ------------------------------------------------- Mark Stowers’ career has taken him across the globe, through South Dakota and back again. The C-suite adviser in agriculture, bioproducts and bioenergy has worked across five continents and now is based in Sioux Falls... [Read More](blog/ag-biotech-leader-helps-startups-from-sioux-falls) July 7th, 2022 DEPSCoR DoD Day --------------- The University of South Dakota will host DEPSCoR DoD Day, presented by the Department of Defense, on July 19, 2022. The DEPSCoR Day will include overviews of basic research opportunities within the DoD... [Read More](blog/depscor-dod-day) June 18th, 2022 SBIR AND STTR FUNDING OPPORTUNITIES ----------------------------------- SBIR and STTR grant funding opportunities offer small business entrepreneurs a chance to obtain non-dilutive funding for early-stage research and development. Applications are accepted three times a year. [Read More](blog/sbir-sttr-funding-opportunities) June 10th, 2022 SD Biotech Member In The News ----------------------------- The success of Prairie AquaTech, a company serving the aquaculture industry from the landlocked state of South Dakota, shows the potential to support the industry here, said Joni Ekstrum, executive director of South Dakota Biotech. [Read More](blog/sd-biotech-member-in-news) May 27th, 2022 SD Bio Board President Steve Lewis awarded the Charles D. Scott Award --------------------------------------------------------------------- CONGRATS to our Board President Steve Lewis! [Read More](blog/sd-bio-board-president-steve-lewis-awarded-charles-d-scott-award) May 9th, 2022 2022 SD Biotech Summit ---------------------- **October 11, 2022 • Swiftel Center, Brookings, SD** The SD Biotech Summit will bring together national, regional and local thought leaders who will provide insights that will impact all of our futures. [Read More](blog/2022-sd-biotech-summit) May 2nd, 2022 SDSU granted $11M for biomedical research ----------------------------------------- The"
